import styles from "../styles/Carousel.module.scss";
// import maltton1 from "../imgs/maltton1.jpg";

function Carousel() {
  return (
    <img
      className={styles.imgCarousel}
      src=""
      alt="chica sentada con una blusa"
    />
  );
}

export default Carousel;
